require 'rails_helper'
require "spec_helper"


RSpec.describe Dashboard::Api::V1::Events::EventsController, type: :controller do
  describe "Dashboard Events APIs" do

    before do
      request.headers["Authorization"] = "eyJhbGciOiJIUzI1NiJ9.eyJ1c2VyX2lkIjozLCJleHAiOjIzNzA3NjUyOTB9.EjolS_kzj3qCLVB8olIefx84QCZDuw_5R7zHQns1fU0"
    end

    it "should create an Event" do
      post :create_event, params: {
      title: "Test Dashboard",
      venue: "islamabad, pakistan",
      event_type: "public",
      over_18: true,
      image: "data:image/jpeg;base64,",
      description: "test description",
      category_ids: [Category.first.id, Category.last.id],
      location: "islamabad, Pakistan"
    }

    expect(response).to have_http_status(200)
    expect(JSON.parse(response.body)["success"]).to eq(true)
    end


    it "should add times to an Event" do
      post :add_times, params: {
      event_id: Event.last.id,
      start_date: "2021-11-11",
      start_time: "11:11:11",
      end_date: "2021-11-22",
      end_time: "22:22:22",
      frequency: "daily",
      is_repetive: true,
      event_dates: ["2021-11-11", "2021-11-12"]
    }

    expect(response).to have_http_status(200)
    expect(JSON.parse(response.body)["success"]).to eq(true)
    end

    it "should add resource to an Event" do
      post :add_admission_resource, params: {
      event_id: Event.last.id,
      price_type: "",
      admission_resources: [
        {
          name: "free",
          fields: [{
            title: "free",
            quantity: "23",
            per_head: "22"
            }]
        }]
    }

    expect(response).to have_http_status(200)
    expect(JSON.parse(response.body)["success"]).to eq(true)
    end

    it "should add sponsor to an Event" do
      post :add_sponsor, params: {
      event_id: Event.last.id,
      sponsor: [
        {
          external_url: "www.test.com",
          sponsor_image: "data:image/jpeg;base64,"
        }]
    }

    expect(response).to have_http_status(200)
    expect(JSON.parse(response.body)["success"]).to eq(true)
    end

    it "should add sponsor to an Event" do
      post :add_media, params: {
      event_id: Event.last.id,
      event_attachments: [
        {
          media_type: "image",
          media: "data:image/jpeg;base64,"
        }]
    }

    expect(response).to have_http_status(200)
    expect(JSON.parse(response.body)["success"]).to eq(true)
    end

    it "should add resource to an Event" do
      post :add_social, params: {
      event_id: Event.last.id,
      event_forwarding: false,
      allow_chat: false
    }

    expect(response).to have_http_status(200)
    expect(JSON.parse(response.body)["success"]).to eq(true)
    end


  end
end
